import React from "react";

import styled from "styled-components";

export const Item = styled.div`
  display: flex;
  flex-direction: column;

  .text {
      font-weight: bold;
  }
`;

export default ({ type, from, value }) => {
  return (
    <Item>
      <span className>{type}</span>
      <span>{from}</span>
      <span>{value}</span>
    </Item>
  );
};
